import React from 'react';

export default function Your_application_form() {
  return (
    <div>
      <p> Here you can preview your application and download it in pdf form</p>
      
      {/* Button container */}
      <div style={{ display: 'flex ', gap: '10px',justifyContent:'center'}}>
        {/* Red Preview Button */}
        <button style={{
          backgroundColor: '#f44336',
          color: 'white',
          padding: '10px 20px',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
          width: '118px',
        }}>
          Preview
        </button>
        
        {/* Blue Payment Button */}
        <button style={{
          backgroundColor: '#2196F3',
          color: 'white',
          padding: '10px 20px',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
          width: '118px',
        }}>
          Payment
        </button>
      </div>
    </div>
  );
}
